import React from "react";

const List = ({ items }) => {
  const data = ['A', 'B', 'C'];


  return (
    <ol>
      {data.map((dt, key) =>
        <li onClick={this.arr}>
          {dt}
        </li>
      )}
      {items.map((item, i) => (
        <li>
          {item}
        </li>
      ))}
    </ol>
  );
};

export default function App() {
  return (
    <div>
      <List items={["A", "B", "C", "D", "E"]} />
    </div>
  );
}
